import React from 'react';
import HeaderItem from "./HeaderItem";

const Header = () => {
    return (
        <header className="header-wrapper">
           <div className="main-icon"></div>
            <HeaderItem path={'/dashboard'} icon={'dashboard'} link={"Dashboard"}/>
            <HeaderItem path={'/temp'} icon={'dashboard'} link={"Dashboard"}/>
            <HeaderItem path={'/tempd1'} icon={'dashboard'} link={"Dashboard"}/>
            <HeaderItem path={'/tedmp1'} icon={'dashboard'} link={"Dashboard"}/>
            <HeaderItem path={'/teddmp1'} icon={'dashboard'} link={"Dashboard"}/>
        </header>
    );
};

export default Header;
